import classes from "./NavigationBar.module.css";
import ProductiviaLogo from "./Productivialogo";

const NavigationBar = () => {
  return (
    <div className={classes["nav-bar"]}>
      <ProductiviaLogo />
      <nav>
        <ul>
          <li></li>
          <li></li>
          <li></li>
        </ul>
      </nav>
    </div>
  );
};

export default NavigationBar;
